import styled from "styled-components";
import Image from "../Imagem/Image";
import Motor from "../Motor/Motor";

const Grid = styled.div`
  width: 350px;
  background-color: transparent;
  color: #fff;
  border-radius: 5px;
  padding: 20px;
  color: black;
  font-size: 100%;
`;
const Grid1 = styled.div`
  padding-left: 100px;
  grid-column: 1;
  grid-row: 2;
`;
const Grid2 = styled.div`
  padding-left: 20px;
  grid-column: 2;
  grid-row: 2;
`;

const Grid3 = styled.div`
  padding-left: 100px;
  grid-column: 2;
  grid-row: 2;
`;

const Container = styled.div`
width: 350px;
height: 20px;
background-color: #444;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 1rem;
`

function CardMotor(params) {
  return (
      <Container>
    <Grid>
      <Grid1>
        <Image />
      </Grid1>
      <Grid2>
        <Motor />
      </Grid2>
      <Grid3>oi</Grid3>
    </Grid>

      </Container>
  );
}

export default CardMotor;
